import React from 'react';
import Card from './Card';
//import {robots} from robots.js as data
import {robots} from './robots';


const CardList = ({robots}) => {
	return(
		<Card 
			key={robots[0].username}
			name={robots[0].name}
			email={robots[0].email}
	/>)
}

export default CardList;
